import React from 'react';

const NavSat = ({ gps }) => (
  <div className="card">
    <h2>Navigation Satellite</h2>
    <p>Latitude: {gps.latitude}</p>
    <p>Longitude: {gps.longitude}</p>
  </div>
);

export default NavSat;
